import React from 'react';
import './style.css';

/**
* @author
* @function Navbar
**/

const Navbar = (props) => {
  return(
    <div className="navbar">
    <ul className="navbarmenu">
        <li><a href="#">Home</a></li>
        <li><a href="#">About US</a></li> 
        <li><a href="#">contact Us</a></li>
    </ul>
    </div>
   )

 }

export default Navbar
